  false,\n\t\"url\": null,\n\t\"notes\": \"This data set is one component of a digital
  terrain model (DTM) for Weeki Wachee, Hernando County, Florida encompassing approximately
  13.5 square miles. This dataset is comprised of 15 LiDAR files, based on the DISTRICT
  5,000' by 5,000' sheet index system, in the LAS file format. The raw data was collected
  on 1 March 2005 at an average ground sample distance of 1-meter. Other components
  of the DTM include: 3-D breaklines along hydrographic features in the Shape file
  format; lake/pond polygons (in 3D) in the shape file format; obscured area polygons
  (in 2D) in the Shape file format; and hard/soft breaklines (in 3D) in the Shape
  file format.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
